// YMaps
function init() {
  ymaps.geolocation.get({
    provider: "yandex"
  }).then(function (res) {
    var g = res.geoObjects.get(0);
    $("input[name=region]").val(g.getAdministrativeAreas()[0]);
  }).catch(function (err) {
    console.log("Не удалось установить местоположение", err);
  });
}

